import "./list.css";
import axios from "axios";
import { useEffect, useState } from "react";

const List = () => {
  const [list, setList] = useState();
  useEffect(() => {
    axios.get("http://localhost:4200/list/").then((res) => {
      setList(res.data);
      console.log(res.data);
    });
  }, []);

  return (
    <div className="list">
      {list.map((list) => (
        <div>
          {list.id}
          {list.name}
        </div>
      ))}
    </div>
  );
};

export default List;
